//github.com/alan2207/slashh"}},{id:"voting-app",title:"Voting App",type:"fullstack",technologies:["Node","Express","MongoDB","Mongoose","React","Redux","Materialize","JWT"],description:"App for creating voting polls. The poll results are visualized using google-charts. Additional options can be added, and every poll can be shared on Twitter.",features:["Registration System","JWT authentication","Poll visualization with google-charts","Add option","Poll sharing on Twitter","Voter detection - disallow multiple votings by the same user"],link:{demo:"http://votings.surge.sh/",repository:"https://github.com/alan2207/voting-app"}},{id:"nightlife-coordination",title:"Nightlife",type:"fullstack",technologies:["Node","Express","MongoDB","Mongoose","React","Redux","Materialize","JWT","Google Maps"],description:"App for viewing bars nearby. By entering the location, the user will receive 20 nearest bars. Users can mark to which bars they are going to go. Users can also view bar locations on the map. The app uses YELP API for getting the bar information, and google-maps for showing locations.",features:["Registration System","JWT authentication","View bars and their locations with google-maps","Guest list for every bar","Mark visiting places","Last location memorization"],link:{demo:"http://nightlife.surge.sh/",repository:"https://github.com/alan2207/nightlife-coordination-app"}},{id:"roguelike-game",title:"Roguelike",type:"frontend",technologies:["React","Redux"],description:"Roguelike game built with react and redux. The map is generated randomly. The black square is the player. The player's goal is to defeat monsters(red squares) while collecting health(green squares) and weapons(gray squares). The game has 5 levels. Upon each level, the damage that monsters do to the player while fighting increases.",features:["Random map generation","Dark mode toggle","5 levels"],link:{demo:"http://react-roguelike.surge.sh/",repository:"https://github.com/alan2207/roguelike-dungeon-crawler-game"}},{id:"stock-market-monitor",title:"Stock Monitor",type:"fullstack",technologies:["Node","Express","MongoDB","Mongoose","React","Socket.io","Bulma"],description:"App for monitoring stock prices history for the last 30 days. The app uses websockets so every change is visible to all clients in real time. The app uses Chart.js for stock price visualization, and quandl API for getting the stock information.",features:["Add stock","Remove stock","Real time changes monitoring","Visualization of stock prices with Chart.js"],link:{demo:"http://stock-monitor.surge.sh/",repository:"https://github.com/alan2207/stock-market-monitor"}},{id:"book-trading-app",title:"Book Trading App",type:"fullstack",technologies:["Node","Express","MongoDB","Mongoose","React","Redux","Bulma","JWT"],description:"App for trading books online. The user can initiate a trade. A trade consists of offering a book that the user owns for a book that the other user owns. Once the trade has been initiated, the user must wait for the other user to accept the trade. When the trade has been accepted, book lists of both users are updated properly.",features:["Registration System","JWT authentication","Add books - google books api as the source for their information","Initiate, accept or cancel trades"],link:{demo:"http://book-trading.surge.sh/",repository:"https://github.com/alan2207/book-trading-app"}},{id:"tic-tac-toe",title:"Tic Tac Toe",type:"frontend",technologies:["JavaScript","HTML","CSS"],description:"Tic Tac Toe game built with plain JavaScript. The user can play against the computer or against another human player. The computer opponent uses minimax algorithm which makes it unbeatable.",features:["Play against the computer or a friend","Score tracking"],link:{demo:"https://alan2207.github.io/tic-tac-toe/",repository:"https://github.com/alan2207/tic-tac-toe"}},{id:"interest",title:"Interest",type:"fullstack",technologies:["Node","Express","MongoDB","Mongoose","React","Redux","Bootstrap","JWT"],